import React from "react";
import moment from "moment";

const Content = (props) => {
  let published = props.publish;
  const url = props.url !== null || props.url !== "" ? props.url : "#";
  const target =
    props.url !== null || props.url !== "" ? { target: "_blank" } : "";
  return (
    <div>
      <div className="card my-5" style={{ width: "100%s" }}>
        <img className="card-img-top" src={props.img} alt="Card image cap" />
        <div className="card-body">
          <h3 className="card-text">
            <a href={props.url}>{props.title}</a>
          </h3>
          <p className="card-text">{props.content}</p>
        </div>
        <ul className="list-group list-group-flush">
          <li className="list-group-item upload-time">
            Last Update {moment({ published }).fromNow()}
          </li>
          <li className="list-group-item">
            <div className="row">
              <div className="col-4">
                <i className="far fa-heart"></i>
              </div>
              <div className="col-4">
                <i className="fa fa-share-alt"></i>
              </div>
              <div className="col-4">
                <i className="far fa-thumbs-down"></i>
              </div>
            </div>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Content;
